	};

	return (
		<div>
			<h1> Criação de Conta </h1>
			<form>
				<label htmlFor="nome"> Nome: </label>
				<input id="nome" type="text"/>
				<span className={!name.status ? "erro" : "hidden"}> {name.error} </span>

				<label htmlFor="email"> Email: </label>
				<input id="email" type="email"/>
				<span className={!email.status ? "erro" : "hidden"}> {email.error} </span>


				<label htmlFor="email"> Confirmar Email: </label>
				<input id="email" type="email"/>
				<span className={!emailConfirmation.status ? "erro" : "hidden"}> {emailConfirmation.error} </span>


				<label htmlFor="senha"> Senha: </label>
				<input id="senha" type="text"/>
				<span className={!password.status ? "erro" : "hidden"}> {password.error} </span>

				<label htmlFor="senha"> Confirmar Senha: </label>
				<input id="senha" type="text"/>
				<span className={!passwordConfirmation.status ? "erro" : "hidden"}> {passwordConfirmation.error} </span>

				<label htmlFor="CPF"> CPF: </label>
				<input id="cpf" type="text"/>
				<span className={!cpf.status ? "erro" : "hidden"}> {cpf.error} </span>

				<label htmlFor="endereco"> Endereço: </label>
				<input id="endereco" type="text"/>
				<span className={!address.status ? "erro" : "hidden"}> {address.error} </span>


				<label htmlFor="telefone"> Telefone: </label>
				<input id="telefone" type="tel"/>
				<span className={!telefone.status ? "erro" : "hidden"}> {telefone.error} </span>


				<input type="submit" value="Criar Conta" className="pink-background"/>
			</form>
		</div>
	);
};

export default SignUp;
